import React, { Component } from "react";
import "../../App.css";

export class Comment extends Component {
  render() {
    return (
      <form>
        <div className="container">
          <div className="row">
            <textarea
              id="commentSection"
              row="5"
              col="30"
              placeholder="Write your comment..."
            ></textarea>
          </div>
          <div className="row">
            div.col-9
            <div className="col-3">
              <button className="btn btn-outline-primary" type="submit">
                Submit
              </button>
            </div>
          </div>
        </div>
      </form>
    );
  }
}

export default Comment;
